import React, {useState} from "react";
import Modal from "react-modal";
import bears2 from '../images/bears2.jpeg';

const Bears2 = () => {
  const [modal_2_IsOpen, set_2_IsOpen] = useState(false);

  const openModal_2 = () => {
    set_2_IsOpen(true);
  }

  const closeModal_2_ = () => {
    set_2_IsOpen(false);
  }

  return (
    <>
      <img onClick={openModal_2} className="square" src={bears2} />
      <Modal 
        isOpen={modal_2_IsOpen}
        onRequestClose={closeModal_2_}
        className="modal"
        ariaHideApp={false}
        closeTimeoutMS={200}
        onAfterOpen
        >
        <div className="container-img">
          <img className="img" src={bears2} />
          <button onClick={closeModal_2_} className="btn">Back</button>
        </div>
        </Modal>
    </>
  )
}

export {Bears2 as default};
